import React from "react";

export default function Home() {
  // Only rendering the header
  return (
    <div className="flex gap-10 sm:divide-x justify-center px-6 py-12 sm:w-1/2 mx-auto items-center sm:flex-row flex-col">
      <div className="w-96 h-96 ">
        <div className="flex justify-between items-center">
          <h1 className="select-none font-semibold">
           -----THIS IS THE PAGE YOU WILL SEE WHEN THE CLIENT IS START UP.-----

           Ricky: I made it because the routing that was here was going nowhere. You need to have separate pages.
           When you login it will take you to the Home.js page, and it should pass user id's with a /welcome/user:id url.
           This page is different than the Home.js page. It is what will show up when you npm start client.


           We can always remove this big text I made and fill it with content that we would want on this page.
          </h1>
        </div>
      </div>
    </div>
  );
}
